import React from "react";
import { connect } from "react-redux";

const Alert = ({ alerts }) =>
  alerts !== null &&
  alerts.length > 0 && (
    <div style={{ fontSize: 50, color: "red" }}>
      hello
      {alert.msg}
    </div>
  );

const mapStateToProps = state => ({
  alerts: state.Alert
});

export default connect(mapStateToProps)(Alert);
